import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import UserContextProvider from "./contexts/user-context";

const root = ReactDOM.createRoot(document.getElementById("root")).render(
    <UserContextProvider>
        <App />
    </UserContextProvider>
);
